py::dict parse(const std::string &code) {
    const char* code_buffer = code.data();

    // ---------- Python Variables ----------

    py::dict result;
    
    result["errors"] = py::list();
    result["tree"]   = py::list();

    std::vector<py::list> tree_stack;
    tree_stack.push_back(result["tree"].cast<py::list>());

    // ---------- Other  Variables ----------

    std::vector<uint64_t> line_start_indexes = {0};

    uint64_t plain_text_start=0, plain_text_end=0;
    uint64_t expression_start=0, expression_end=0;
    uint64_t directive_start=0, directive_end=0;

    enum class Directive : uint8_t {
        FOR,IF,ELSE,END
    } directive{};

    enum class vType : uint8_t {
        VAL,VAR
    } v_type;

    // ---------- DFA CODE ----------

    uint64_t ptr = 0;
    uint16_t transition = 0;
    uint8_t& state  = *(reinterpret_cast<uint8_t*>(&transition) + 0); // Least significant byte on LE systems, Most  in BE ones. 
    uint8_t& pstate = *(reinterpret_cast<uint8_t*>(&transition) + 1); // Most  significant byte on LE systems, Least in BE ones. 

    while (ptr <= code.size()) {
        pstate = state;
        state = code_dfa[state][static_cast<uint8_t>(code_buffer[ptr])];

        switch (state) {
            case 0x01:
                {
                    line_start_indexes.push_back(ptr+1);
                } break;
            case 0x12:
                {
                    if (pstate!=0x12);
                    // Log de erro expressão não fechada por quebra de linha
                } break;
            case 0x22:
                {
                    expression_end = ptr;
                } break;
            case 0x02:
            case 0x27:
                {
                    plain_text_end = ptr;
                } break;
            case 0x03:
            case 0x2B:
                {
                    py::dict node;
                    node["type"] = "plain_text";
                    node["text"] = py::str(reinterpret_cast<const char*>(code_buffer + plain_text_start), plain_text_end - plain_text_start);
                    tree_stack.back().append(node);
                } break;
            case 0x1D:
                {
                    v_type = vType::VAR;
                } break;
            case 0x1E:
                {
                    v_type = vType::VAL;
                } break;
        }

        switch (transition) {
            case 0x2200:
                {
                    py::dict node;
                    node["type"] = "expression";
                    node["text"] = py::str(reinterpret_cast<const char*>(code_buffer + expression_start), expression_end - expression_start);
                    tree_stack.back().append(node);
                } break;
            case 0x0311:
            case 0x0321:
            case 0x031B:
            case 0x0322:
            case 0x1011:
            case 0x1021:
            case 0x101B:
            case 0x1022:
            case 0x2B11:
            case 0x2B21:
            case 0x2B1B:
                {
                    expression_start = ptr;
                } break;
        }

        ++ptr;
    }

    return result;
}

